import React, { Component } from 'react';
import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";

class Content extends Component(){

	render(){
		return(
			<React.fragment>
				<div class="container">
					<div class="box">
						<img src=".../public/logo192.png"/>
					</div>
				</div>
			</React.fragment>
			)
	}

    
}

export default Content;
